		if (!knightsTurn && occupationState) {
			avatarInZone.moveAvatar(PASSED_KNIGHT, ZERO_EXTRA);
			occupationState = false;
			//avatarInZone = null;
		}
	}
	@Override
	public void failed() {
		if (!knightsTurn && occupationState) {
			avatarInZone.moveAvatar(GORGE_X, GORGE_Y);
			occupationState = false;
		}
