package grail.extras;

import java.awt.event.ActionEvent;
import java.awt.event.ActionListener;

import javax.swing.JButton;

import grail.compositeFigs.BridgeSceneFactory;
import grail.compositeFigs.FiveAvatars;

public class ButtonController implements ActionListener {

	static final String AVATAR_SAY = "I did it!";

	JButton passed;
	JButton say;
	JButton failed;
	JButton approach;
	FiveAvatars bridgeScene;

	public ButtonController(JButton pass, JButton talk, JButton fail, JButton goToZone) {
		passed = pass;
		say = talk;
		failed = fail;
		approach = goToZone;
		bridgeScene = BridgeSceneFactory.bridgeSceneFactoryMethod();

	}

	@Override
	public void actionPerformed(ActionEvent e) {
		if (e.getSource() == passed) {
			bridgeScene.passed();
		}
		else if (e.getSource() == say) {
			bridgeScene.say(AVATAR_SAY);
		}
		else if (e.getSource() == failed) {
			bridgeScene.failed();
		}
		else if (e.getSource() == approach) {
			bridgeScene.approach(bridgeScene.getLancelot());
		}
	}

}

